        this.state = {
             intital:0,
             userDetails:[] 
        }

   }

    componentDidMount(){        

         axios.get('/dashboard').then (response=>{
              this.setState({
                   userDetails:response.data
               })
     }).catch(err=>{
        console.log(err);

    })


      }


     render() {
    return <>
    <Header />

        {this.state.userDetails.map(ele=>{
             return <h5> ele</h5>
            }) 
